package com.example.demo.image;

import org.springframework.stereotype.Service;

import java.util.List;

@Service
public class ImageService {
   final String base64 = "data:image/jpeg;base64,";
   final String secondBase64 = "";
   final String threeBase64 = "";
   final String fourBase64 = "";

   public List<Image> getImage() {
      return List.of(
              new Image(
                      this.base64 + this.secondBase64 + this.threeBase64 + this.fourBase64
              )
      );
   }
}
